  isDisabled = false,
}) => {
  return (
    <Container onClick={onClick} disabled={isDisabled}>
      <ButtonPlus>
        <PlusIcon>
          <use href={icon + '#icon-plus-1'}></use>
        </PlusIcon>
      </ButtonPlus>
      <TitleButton>{btnTitle}</TitleButton>
    </Container>
  );
};

export default ButtonPlus;
